import React from 'react';
import '../styles/Photos.css';

const photos = [
  { id: 1, src: 'https://media.istockphoto.com/id/1296313099/photo/a-scene-of-a-general-hospital-premises-on-a-busy-morning-where-patients-are-seen-waiting-for.jpg?s=612x612&w=0&k=20&c=99jpmmKgJ8BF7JhrbENyMXh-7XnD9UWmK-NcCpg5XU0=', alt: 'Photo 1' },
  { id: 2, src: 'https://media.istockphoto.com/id/1296313099/photo/a-scene-of-a-general-hospital-premises-on-a-busy-morning-where-patients-are-seen-waiting-for.jpg?s=612x612&w=0&k=20&c=99jpmmKgJ8BF7JhrbENyMXh-7XnD9UWmK-NcCpg5XU0=', alt: 'Photo 2' },
  { id: 3, src: 'https://media.istockphoto.com/id/1084862604/photo/young-businesswoman-in-eyeglasses-working-on-laptop-at-workplace-in-office.jpg?s=612x612&w=0&k=20&c=JfMBB2-Si5slvdjLMlGqd7DgywLLUJGeLTjcX0NTl24=', alt: 'Photo 3' },
  { id: 4, src: 'https://media.istockphoto.com/id/1084862604/photo/young-businesswoman-in-eyeglasses-working-on-laptop-at-workplace-in-office.jpg?s=612x612&w=0&k=20&c=JfMBB2-Si5slvdjLMlGqd7DgywLLUJGeLTjcX0NTl24=', alt: 'Photo 4' },
  { id: 5, src: 'https://media.istockphoto.com/id/1084862604/photo/young-businesswoman-in-eyeglasses-working-on-laptop-at-workplace-in-office.jpg?s=612x612&w=0&k=20&c=JfMBB2-Si5slvdjLMlGqd7DgywLLUJGeLTjcX0NTl24=', alt: 'Photo 5' },
  { id: 6, src: 'https://media.istockphoto.com/id/1282874956/photo/concentrated-fashion-woman-working-on-computer-in-her-office.jpg?s=612x612&w=0&k=20&c=zI5SEm7gxbM9bnjGf8GQF90PKJWR0PjUyRu-JnnGezQ=', alt: 'Photo 6' },
  { id: 7, src: 'https://media.istockphoto.com/id/1182122416/photo/young-business-woman-in-an-office.jpg?s=612x612&w=0&k=20&c=9Tst6IS7rOqv9TxJrCMEtOZp2OlLbz_9QeOCg8dkbJg=', alt: 'Photo 7' },
  { id: 8, src: 'https://media.istockphoto.com/id/1084862604/photo/young-businesswoman-in-eyeglasses-working-on-laptop-at-workplace-in-office.jpg?s=612x612&w=0&k=20&c=JfMBB2-Si5slvdjLMlGqd7DgywLLUJGeLTjcX0NTl24=', alt: 'Photo 8' },
  { id: 9, src: 'https://media.istockphoto.com/id/1182122416/photo/young-business-woman-in-an-office.jpg?s=612x612&w=0&k=20&c=9Tst6IS7rOqv9TxJrCMEtOZp2OlLbz_9QeOCg8dkbJg=', alt: 'Photo 9' },
  { id: 10, src: 'https://media.istockphoto.com/id/1084862604/photo/young-businesswoman-in-eyeglasses-working-on-laptop-at-workplace-in-office.jpg?s=612x612&w=0&k=20&c=JfMBB2-Si5slvdjLMlGqd7DgywLLUJGeLTjcX0NTl24=', alt: 'Photo 10' },
  { id: 11, src: 'https://media.istockphoto.com/id/1282874956/photo/concentrated-fashion-woman-working-on-computer-in-her-office.jpg?s=612x612&w=0&k=20&c=zI5SEm7gxbM9bnjGf8GQF90PKJWR0PjUyRu-JnnGezQ=', alt: 'Photo 11' },
];

const Photos = () => {
  return (
    <div className="content">
      {/* AGENTS Section */}
      <div className="agents-section">
        <h1 className="agents-title">AGENTS</h1>
      </div>

      {/* Gallery Section */}
      <div className="gallery-section">
        <div className="gallery">
          {photos.map((photo) => (
            <div key={photo.id} className="photo">
              <img src={photo.src} alt={photo.alt} />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Photos;
